import React from 'react';
import './../styles/Productscontainer.css';

const Productscontainer = () => {
    return (
        <div className="Product-container" onLoad={showProducts}>

        </div>
    )

    function showProducts() {

        var products = {
            product1 : {
                productimage: "./../images/sunscreen.png",
                productname: "Face Powder With Sunscreen",
                productprice: "$500"
            },
            product2 : {
                productimage: "./../images/foundation.png",
                productname: "Weightless Mousse Foundation",
                productprice: "$350"
            },
            product3 : {
                productimage: "./../images/nailcolor-remover.png",
                productname: "Nail Color Remove",
                productprice: "$120"
            },
            product4 : {
                productimage: "./../images/insta-eyeliner.png",
                productname: " Insta Eye Liner",
                productprice: "$300"
            },
            product5 : {
                productimage: "./../images/sheet-facepack.png",
                productname: "Blush & Glow Strawberry Sheet Mask",
                productprice: "$180"
            },
            product6 : {
                productimage: "./../images/shine-eyeliner",
                productname: "Absolute Shine Line Eye Liner ",
                productprice: "$750"
            }
        };
        console.log(products);

        let productList = [];
        const container = document.getElementsByClassName("Product-container")[0];
        productList.forEach(element => {
            let products = `<div class="Product-card">
            <div class="Product-image">
                <img src="${element.productimage}" alt="img">
            </div>
            <div class="Product-details">
               <h3 class="Product-name">${element.productname}</h2>
               <h4 class="Product-price">${element.productprice}</h4>
               <h5 class="Add-button">Add to Cart</h5>
            </div>
            </div>`;

            container.insertAdjacentHTML('beforeend', products);
            console.log(element);
        })
    }
}

export default Productscontainer;
